import React from 'react'
import { useState } from 'react'
export const Register = () => {
    const [email,setEmail]=useState('')
    const [username,setUsername]=useState('')
    const [city,setCity]=useState('')
    const [country,setCountry]=useState('')
    const [phone,setPhone]=useState('')
    const[password,setPassword]=useState('')

    const handleSubmit=async(e)=>{
        e.preventDefault()
    }
  return (
    <div>
     <form className='register' onSubmit={handleSubmit}>
        <h3>Register</h3>
        <input type="text" onChange={(e)=>setUsername(e.target.value)} value={username}></input>
        <input type="text" onChange={(e)=>setEmail(e.target.value)} value={email}></input>
        <input type="text" onChange={(e)=>setPassword(e.target.value)} value={password}></input>
        <input type="text" onChange={(e)=>setPhone(e.target.value)} value={phone}></input>
        <input type="text" onChange={(e)=>setCountry(e.target.value)} value={country}></input>
        <input type="text" onChange={(e)=>setCity(e.target.value)} value={city}></input>
        <button>Register Now</button>
     </form>
    </div>
  )
}
